// BETTER WINDOW ALTERNATIVE
// GET THE FIRST WINDOW SOLUTION 
// MOVE WINDOW POINTERS AND INCREMENT/DECREMENT
// WITH EACH ITERATION
function maxVowels(s: string, k: number): number {
  const vowels = new Set(['a', 'e', 'i', 'o', 'u']);
  let m = 0;
  
  for (let i = 0; i < k; i++) {
    if (vowels.has(s[i])) {
      m++;
      if (m === k) return k;
    }
  }
  
  let p = 0;
  let c = m;
  while (p + k < s.length) {
    if (vowels.has(s[p]) && c > 0) {
      c--;
    }
    
    if (vowels.has(s[p + k])) {
      c++;
    }
    
    if (c > m) {
      m = c;
    }
    
    if (c === k) return k;
    p++;
  }
  
  return m;
}

